function boxMullerRandom() {
    let phase = true, x1, x2, w;
    return (function () {
        if (phase) {
            do {
                x1 = 2.0 * Math.random() - 1.0;
                x2 = 2.0 * Math.random() - 1.0;
                w = x1 * x1 + x2 * x2;
            } while (w >= 1.0);
            w = Math.sqrt((-2.0 * Math.log(w)) / w);
            return x1 * w;
        }
        else {
            return x2 * w;
        }
    })();
}
